INSERT INTO `ext_translations` VALUES (1,'en','AppEntityFieldChoices','choiceLabel','1','Keep the dimensions of the imported image'),(2,'en','AppEntityFieldChoices','choiceLabel','2','Resize the image'),(3,'en','AppEntityFieldChoices','choiceLabel','5','Origine'),(4,'en','AppEntityFieldChoices','choiceLabel','6','JEPEG extension'),(5,'en','AppEntityFieldChoices','choiceLabel','7','PNG extension'),(6,'en','AppEntityFieldChoices','choiceLabel','8','From this image'),(7,'en','AppEntityFieldChoices','choiceLabel','9','Personalize'),(8,'en','AppEntityFieldGroup','labelText','1','Size'),(9,'en','AppEntityFieldGroup','labelText','4','GIF Animated before after'),(10,'en','AppEntityFieldGroup','labelText','5','Additional information'),(11,'en','AppEntityFieldGroup','labelText','6','Watermark'),(12,'en','AppEntityFieldGroup','labelText','7','For 2D Photo-Staging, need to write:'),(13,'en','AppEntityField','labelText','2','Height'),(14,'en','AppEntityField','labelText','3','Width'),(15,'en','AppEntityField','labelText','6','Would you like to insert your logo ?'),(16,'en','AppEntityField','labelText','7','Choose your Logo'),(17,'en','AppEntityField','labelText','8','Choose the position of the logo'),(18,'en','AppEntityField','labelText','9','Would you like an animated GIF before-after of your image?'),(19,'en','AppEntityField','labelText','11','Tapez votre filigrane'),(20,'en','AppEntityField','labelText','12','Choose your Logo'),(21,'en','AppEntityField','labelText','13','Choose the position of the logo'),(22,'en','AppEntityField','labelText','14','if you had any special instructions to send us, write here:'),(23,'en','AppEntityField','labelText','15','Do you want to insert a watermark?'),(24,'en','AppEntityField','labelText','16','Type your watermark'),(25,'en','AppEntityField','labelText','17','Choose your watermark'),(26,'en','AppEntityField','labelText','18','Choose the position of the watermark'),(27,'en','AppEntityField','labelText','19','Non-contractual renovation proposal.'),(28,'en','AppEntityField','labelText','20','Non-contractual renovation project.'),(29,'en','AppEntityRetouch','title','5','VIRTUAL PHOTO-STAGING'),(30,'en','AppEntityRetouch','description','5','<p>For indoor photos. - Inlay of furniture / creation of Ambiance. - - Delivery delivered by default, to \"about 1 week\", even if included in 1 order in 48h or 24h.</p>'),(31,'en','AppEntityRetouch','title','6','RELEVANCE  INTERIOR '),(32,'en','AppEntityRetouch','description','6','<p>For indoor photos.</p><p>Virtual storage and decluttering:</p><p>- We store personal belongings,</p><p>- We unclutter the interior layout,</p><p>- We balance chromie &amp; light,</p><p>- We correct the optical distortions,</p><p>- We recover the external views.</p><p>This service has its limits, it requires to be able to reconstitute the materials, the forms, the style, the design of the furniture ...</p>'),(33,'en','AppEntityRetouch','title','7','RELEVANCE \"EXTERIOR\"'),(34,'en','AppEntityRetouch','description','7','<p>For outdoor photos.</p><p>Virtual storage and decluttering :</p><p>- We store personal belongings.</p><p>- We unclutter the exterior layout.</p><p>- We balance chromie &amp; light.</p><p>- We correct the optical distortions.</p>'),(35,'en','AppEntityRetouch','title','8','\"OUTDOOR\" LAYOUT'),(36,'en','AppEntityRetouch','description','8','<p>For outdoor photos.</p><p>- We arrange your outdoor spaces according to your requests,</p><p>- We create non-existent lawns,</p><p>- We decorate your spaces of floral ornamentation, shrubs,</p><p>- We encrust garden furniture,</p><p>- We work the facades of goods,</p>'),(37,'en','AppEntityFieldGroup','labelText','13','For each image 1, define the wall and / or floor renovation choices that we have pre-selected for you.'),(38,'en','AppEntityField','labelText','29',NULL),(39,'en','AppEntityFieldRenovationType','typeName','1','Wall'),(40,'en','AppEntityFieldRenovationType','typeName','2','Sol'),(41,'en','AppEntityFieldGroup','labelText','14','BULE SKY'),(42,'en','AppEntityField','labelText','30','Would you like a blue sky in season?'),(43,'en','AppEntityRetouch','title','0','BLUE SKY'),(44,'en','AppEntityRetouch','description','0','<p>For outdoor images.</p><p><strong>Only</strong> the sky is retouched.</p><p><br></p><p>&nbsp; Weather in grisaille, rainy or insipid sky?</p><p>- We apply a blue sky of season.</p><p>- We adapt the chromium to reflections: windows, rivers, rivers, seas ...</p><p><br></p>'),(45,'en','AppEntityRetouch','title','1','RELEVANCE 360'),(46,'en','AppEntityRetouch','description','1','<p>For indoor photos.</p><p>Virtual storage:</p><p>- We store personal belongings,</p><p>- We balance chromie &amp; light,</p><p>- We recover the external views.</p><p>- No correction of optical distortions.</p>'),(47,'en','AppEntityRetouch','title','2','2D PHOTO-STAGING'),(48,'en','AppEntityRetouch','description','2','<p>Empty / renovate</p><p>- We completely empty the room, We remove the curtains only when the external view and door frames are visible, to restore.</p><p>- We renovate floors, walls and ceilings, according to your requests, those of your customers or pre-selected samples.</p><p>- You can now project yourself into the current good, emptied of its content, with your future choices of color and material.</p>'),(49,'en','AppEntityRetouch','title','3','BALANCING'),(50,'en','AppEntityRetouch','description','3','<p>The content of your photo is good, but the rendering of the image unsatisfactory:</p><p>* We balance the chromium, the light.</p><p>* We correct the optical distortions.</p><p>* We recover (uncork) the external views.</p><p>* The content of the image is not retouched.</p>'),(51,'en','AppEntityRetouch','title','9','CREEPUSCULE\'S ATMOSPHERE'),(52,'en','AppEntityRetouch','description','9','<p>Outdoor photos.</p><p>For refined atmospheres, or cozy end of the day.</p><p>- We apply a sunset sky,</p><p>- We adapt the chromium to reflections: windows, rivers, rivers, seas ...</p><p>- We turn on your outdoor lights,</p><p>- We highlight your pools.</p>'),(53,'en','AppEntityField','labelText','10',NULL),(54,'en','AppEntityRetouch','title','10',NULL),(55,'en','AppEntityRetouch','description','10',NULL),(56,'en','AppEntityField','labelText','1',NULL),(57,'en','AppEntityField','labelText','4',NULL),(58,'en','AppEntityFieldChoices','choiceLabel','3','PX'),(59,'en','AppEntityFieldChoices','choiceLabel','4','CM'),(60,'en','AppEntityFieldGroup','labelText','3','Logo'),(61,'en','AppEntityRetouch','title','11','BLUE SKY 360'),(62,'en','AppEntityRetouch','description','11','<p>Weather in grisaille, rainy or bleak sky?</p><p>- We apply a blue sky of season.</p><p>- We adapt the chromium to reflections: windows, rivers, rivers, seas ...</p><p>- We \"dry\" the terraces or sidewalks ...</p>'),(63,'en','AppEntityRetouch','title','12','RELEVANCE  INTERIOR '),(64,'en','AppEntityRetouch','description','12','<p>For indoor photos.</p><p>Virtual storage and decluttering:</p><p>- We store personal belongings,</p><p>- We unclutter the interior layout,</p><p>- We balance chromie &amp; light,</p><p>- We correct the optical distortions,</p><p>- We recover the external views.</p><p>This service has its limits, it requires to be able to reconstitute the materials, the forms, the style, the design of the furniture ...</p>'),(65,'en','AppEntityRetouch','title','13','RELEVANCE  EXTERIOR '),(66,'en','AppEntityRetouch','description','13','<p>For outdoor photos.&nbsp;<span style=\"font-size: 0.9375rem;\">Virtual storage and decluttering :</span></p><p>- We store personal belongings.</p><p>- We unclutter the exterior layout.</p><p>- We balance chromie &amp; light.</p><p>- We correct the optical distortions.</p>'),(67,'en','AppEntityRetouch','title','14','PHOTO STAGING 2D'),(68,'en','AppEntityRetouch','description','14','<p style=\"text-align: right;\"><font color=\"#4272d7\"><span style=\"font-size: 14px;\">Empty / renovate</span></font></p><p style=\"text-align: right;\"><font col