INSERT INTO `retouch` VALUES (1,'CIEL BLEU','<p>Mto  la grisaille, pluvieuse ou ciel fade ?</p><p>-    Nous appliquons un ciel bleu de saison.</p><p><span style=\"font-size: 0.9375rem;\">-    Nous adaptons la chromie aux reflets : vitrages, rivires, fleuves, mers...</span></p><p>- Nous schons les routes et les trottoirs, quand c\'est ralisable.</p>',10,NULL,'application.type.emmobilier'),(2,'PERTINENCE 360','<p>Pour les photos dintrieur.</p><p>Rangement virtuel :</p><p>- Nous rangeons les effets personnels,</p><p>- Nous quilibrons chromie &amp; lumire, </p><p>- Nous rcuprons les vues extrieures.</p><p>- Pas de correction des distorsions optiques.</p>',3,NULL,'application.type.emmobilier'),(3,'PHOTO-STAGING 2D','<p>Vider / rnover</p><p>- Nous vidons intgralement la pice, Nous enlevons les rideaux uniquement quand la vue extrieure et les huisseries sont visibles, pour reconstituer.</p><p>- Nous rnovons sols, murs et plafonds, suivant vos demandes, celles de vos clients ou des chantillons prslectionns.</p><p>- Vous pouvez dsormais vous projeter dans le bien actuel, vid de son contenu, avec vos futurs choix de couleur et de matire.</p>',6,NULL,'application.type.emmobilier'),(4,'QUILIBRAGE','<p>Le contenu de votre photo est bon, mais le rendu de limage insatisfaisant :</p>\r\n<p>* Nous quilibrons la chromie, la lumire.</p>\r\n<p>* Nous corrigeons les distorsions optiques.</p>\r\n<p>* Nous rcuprons (dbouchons) les vues extrieures.</p>\r\n<p>* Le contenu de limage nest pas retouch.</p>',5,NULL,'application.type.emmobilier'),(5,'PHOTO-STAGING VIRTUEL','<p><strong>Pour les photos d\'intrieur.</strong></p><ul><li><span style=\"font-size: 0.9375rem;\">Modlisation et Incrustation de mobilier.</span><br></li><li><span style=\"font-size: 0.9375rem;\">Cration de l\'ambiance de la pice.</span></li><li><span style=\"font-size: 0.9375rem;\">Prestation livre par dfaut,  \"environ 1 semaine\", mme si incluse dans une commande en 48h ou 24h<br></span></li></ul><p>Nous vous remercions de nous communiquer les plans, afin de respecter la conformit de la construction et la cohrence des dimensions du mobilier incrust et de l\'amnagement.</p><br><br>',7,NULL,'application.type.emmobilier'),(6,'PERTINENCE  INTRIEUR ','<p>Pour les photos dintrieur.</p><p>Rangement et dsencombrement virtuels :</p><p>- Nous rangeons les effets personnels,</p><p>- Nous dsencombrons lagencement intrieur,</p><p>- Nous quilibrons chromie &amp; lumire,</p><p><span style=\"font-size: 0.9375rem;\">- Nous corrigeons les distorsions optiques,</span></p><p><span style=\"font-size: 0.9375rem;\">- Nous rcuprons les vues extrieures.</span><br></p><p><span style=\"font-size: 0.9375rem;\">Cette prestation a ses limites, elle ncessite de pouvoir reconstituer les matires, les formes, le style, le design du mobilier </span><br></p>',1,NULL,'application.type.emmobilier'),(7,'PERTINENCE  EXTRIEUR ','<p>Pour les photos dextrieur.\r\nRangement et dsencombrement virtuels :</p>\r\n<p>- Nous rangeons les effets personnels,</p>\r\n<p>- Nous dsencombrons lagencement extrieur,</p>\r\n<p>- Nous quilibrons chromie &amp; lumire, </p>\r\n<p>- Nous corrigeons les distorsions optiques,</p>',2,NULL,'application.type.emmobilier'),(8,'AMNAGEMENT  EXTRIEUR ','<p><strong>Pour les photos dextrieur.</strong></p><ul><li><span style=\"font-size: 0.9375rem;\">Nous amnageons vos espaces extrieurs suivant vos demandes,</span><br></li><li><span style=\"font-size: 0.9375rem;\">Nous crons les pelouses inexistantes,</span><br></li><li><span style=\"font-size: 0.9375rem;\">Nous agrmentons vos espaces dornementation florale, darbustes,</span><br></li><li><span style=\"font-size: 0.9375rem;\">Nous incrustons les mobiliers de jardin,</span><br></li><li><span style=\"font-size: 0.9375rem;\">Nous travaillons les faades des biens.</span><br></li></ul><p>Prestation livre par dfaut,  \"environ 1 semaine\", mme si incluse dans une commande en 48h ou 24h.</p><br>',4,NULL,'application.type.emmobilier'),(9,'AMBIANCE de CRPUSCULE','<p>Photos dextrieur.</p>\r\n<p>Pour des ambiances raffines, ou cosy de fin de journe.</p>\r\n<p>-    Nous appliquons un ciel de tombe du jour,</p>\r\n<p>-    Nous adaptons la chromie aux reflets : vitrages, rivires, fleuves, mers...</p>\r\n<p>-    Nous allumons vos luminaires extrieurs,</p>\r\n<p>-    Nous mettons en valeur vos piscines.</p>',9,NULL,'application.type.emmobilier'),(10,'CIEL BLEU','<p>Mto  la grisaille, pluvieuse ou ciel fade ?</p><p>- Nous appliquons un ciel bleu de saison.</p><p>- Nous adaptons la chromie aux reflets : vitrages, rivires, fleuves, mers...</p><p>- Nous  schons  les terrasses ou trottoirs...</p>',NULL,'CIEL_BLEU','application.type.immosquare'),(11,'CIEL BLEU 360','<p>Mto  la grisaille, pluvieuse ou ciel fade ?</p><p>- Nous appliquons un ciel bleu de saison.</p><p>- Nous adaptons la chromie aux reflets : vitrages, rivires, fleuves, mers...</p><p>- Nous  schons  les terrasses ou trottoirs...</p>',8,NULL,'application.type.emmobilier'),(12,'PERTINENCE  INTRIEUR ','<p>Pour les photos dintrieur.</p><p>Rangement et dsencombrement virtuels :</p><p>- Nous rangeons les effets personnels,</p><p><span style=\"font-size: 0.9375rem;\">- Nous dsencombrons lagencement intrieur,</span><br></p><p>- Nous quilibrons chromie &amp; lumire,</p><p>- Nous corrigeons les distorsions optiques,</p><p>- Nous rcuprons les vues extrieures.</p><p>Cette prestation a ses limites, elle ncessite de pouvoir reconstituer les matires, les formes, le style, le design du mobilier </p>',NULL,'PERTINENCE_INTERIEUR','application.type.immosquare'),(13,'PERTINENCE  EXTRIEUR ','<p>Pour les photos dextrieur.&nbsp;<span style=\"font-size: 0.9375rem;\">Rangement et dsencombrement virtuels :</span></p><p>- Nous rangeons les effets personnels,</p><p>- Nous dsencombrons lagencement extrieur,</p><p>- Nous quilibrons chromie &amp; lumire,</p><p>- Nous corrigeons les distorsions optiques,</p>',NULL,'PERTINENCE_EXTERIEUR','application.type.immosquare'),(14,'PHOTO-STAGING 2D','<p>Vider / rnover</p><p><span style=\"font-size: 0.9375rem;\">- Nous vidons intgralement la pice.</span></p><p><span style=\"font-size: 0.9375rem;\">- Nous enlevons les rideaux quand la vue extrieure et les huisseries sont visibles, pour reconstituer.</span></p><p>- Nous rnovons sols, murs et plafonds, suivant vos demandes, celles de vos clients. Des chantillons prslectionns sont galement proposs.&nbsp;</p><p>Vous pouvez dsormais vous projeter dans le bien actuel, vid de son contenu, avec vos futurs choix de couleurs et de matires.</p>',NULL,'PHOTO_STAGING_2D','application.type.immosquare'),(15,'QUILIBRAGE','<p><strong>Le contenu de votre photo est bon, mais le RENDU de limage insatisfaisant :</strong></p><p></p><ul><li><span style=\"font-size: 0.9375rem;\">Nous quilibrons la chromie, la lumire.</span><br></li><li><span style=\"font-size: 0.9375rem;\">Nous corrigeons les distorsions optiques.</span><br></li><li><span style=\"font-size: 0.9375rem;\">Nous rcuprons (dbouchons) les vues extrieures.</span><br></li></ul><p></p><p>Le contenu de limage nest pas retouch.</p>',NULL,'EQUILIBRAGE','application.type.immosquare');
